import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body-navbar.css';
class Bodynavbar extends Component {
  render(){
  return (
    <div class="navbar1">
      <a href="#home"><i class="fas fa-home"></i></a>
      <div class="subnav">
        <button class="subnavbtn">Áo </button>
        <div className="row">
          <div class="subnav-content col">
            <div>Áo</div>
            <div>Sản phẩm mới</div>
            <div>Áo sơ mi</div>
            <div>Áo thun</div>
            <div>Áo khoác</div>
          </div>
          <div className="col">
            <img src="http://localhost:4000/anh/menu-ao-92w"></img>
          </div>
          </div>
      </div> 
    </div>

  );
}}

export default Bodynavbar;
